import React from "react"

function Icon(props){

 return  (
    <div 
      style = {{color: props.color, cursor: "pointer"}}   className="my-tooltip">
        <i className ={props.typeIcon}>
           <span className="my-tooltiptext">{props.typeText}</span>
        </i>
    </div>)
}

export default Icon;
